import React, { useState } from 'react'
import { FaTrashAlt} from 'react-icons/fa';

const Content = () => {
    const[items , setItems] = useState(
    [{
        id:1,
        checked:true,
        item : "Learn Reactjs"
    },
    {
        id:2,
        checked:false,
        item : "Practise Reactjs"
    },
    {
        id:3,
        checked:true,
        item : "Learn AI"
    }

    ])




    return(
        <main>

            <ul>
                {items.map((item)=>(
                    <li className='item'>
                        <input
                            type="checkbox"
                            checked={item.checked}
                        />  
                        <label>{item.item}</label>

                        <FaTrashAlt
                         role='button'
                         tabIndex={0}

                        />


                    </li>


                ))}
            </ul>


        </main>
    )
}

export default Content;
